description:
The Contura has a unique body with rounded sides for easier stirring, better visibility and easy removal of food. For difficult dishes which require a lot of stirring, the Contura is the ideal cooker. Stay-cool handles. Recommended for use on gas stoves. Ideal for 4 or 5 persons. 
Features & Benefits: 

New improved pressure regulator; 
Operates at 1 kg/cm2 (15 pounds/square inch) pressure; 
Saves more fuel; 
Thermal efficient; heats fast and evenly; 
Cooks faster; 
Curved body for easy stirring; 
Pressure-locked Safety lid – cannot be opened while there is pressure inside;
Safety valve under lid handlebar for greater safety; 
Gasket lasts longer since it is not rubbed during opening or closing; 
Made from pure virgin aluminium.

Brand : NanoNine ; 
Capacity : 700 ml ; 
Color : Silver ; 
Usage : Curries , Rice , Idlies , Pasta Etc ; 
Material : Stainless Steel ;
Lid : Air Tight Food frade ;
Content : Set of 4 .
